import React from 'react'
import BookCard from './books'

const booklist = (props) => {
    return (
        <div className="list">
            {
                props.books.map((book,i) => {
                    return <BookCard
                            key={i}
                            image={book.volumeInfo.imageLinks.thumbnail}
                            title={book.title}
                            author={book.author}
                            published={book.publishedDate}
                            />
                })
            }
        </div>
    )
}

export default booklist
